import React from 'react'

function ContactCard(props){
    const renderlist =  props.Contacts.map((contact) =>{
        return 
        (
            <div>
            <p>contact.name</p>
            <p>contact.email</p>
        </div>
            )
    });
    console.log(renderlist);
    return (
        <div>
            {renderlist}
        </div>
    )
}

export default ContactCard;
